        "title": "El pique de los artistas de LOS40 con nuestro 'RETO ENCADENADO’ | LOS40",
        "description": "En LOS40 Music Awards 2020 pusimos a prueba a los artistas con nuestro reto encadenado ¿Las reglas del juego? Muy fáciles. Nosotros planteamos un reto al primer artista y éste tenía que aceptarlo y retar al siguiente a lo que quisiera: cantar, bailar, imitar o hacer cualquier disparate que se le pasara por la cabeza en ese momento.\n\nPropusimos a David Otero comenzar cantando su última canción usando solo la \"a\" como única vocal. El artista cumplió y lanzó su reto para Willy de Taburete y éste a su vez lanzó su locura para el siguiente invitado hasta forma un reto encadenado impredecible y muy loco.\n\nLola Índigo, David Otero, Beret, Lali, Pablo Alborán, Ana Guerra, Bombai, Manuel Carrasco, Camilo, Ana Mena, Dani Fernández o David Bisbal fueron algunos de los cantantes que se dejaron la piel en el desafío de LOS40. Pero también otros rostros conocidos como Vanesa Romero o Dulceida.\n\nSi quieres música y entretenimiento, cine y TV, bromas o juegos y challenges con los artistas, influencers y celebrities del momento, no olvides suscribirte a nuestro canal:\nhttp://www.youtube.com/subscription_center?add_user=los40principales\n\n⭐️⭐️⭐️⭐️⭐️⭐️⭐️⭐️⭐️⭐️⭐️⭐️⭐️⭐️⭐️\n\nNuestras redes sociales:\n\nhttps://twitter.com/Los40\nhttps://www.facebook.com/los40/\nhttp://instagram.com/los40spain\n\nEscucha la radio más global y con mejores canciones del momento: https://play.los40.com/\nNuestra hermana mayor, LOS40 Classic, una radio llena de los grandes éxitos de los años 80 o los 90:\nhttps://play.los40.com/emisora/los40_classic/\nLa mejor música dance, en LOS40 Dance: https://play.los40.com/emisora/los40_dance/\nO perrea con LOS40 Urban:\nhttps://play.los40.com/emisora/los40_urban/\nConsulta el chart musical más potente del mundo hispanohablante: la Lista de LOS40: http://los40.com/lista40/?o=VL40\n\nY diviértete con nosotros y con los cantantes y grupos más exitosos del momento: http://los40.com/\n\n⭐️⭐️⭐️⭐️⭐️⭐️⭐️⭐️⭐️⭐️⭐️⭐️⭐️⭐️⭐️\n#LOS40 #Reto #Artista